const Ipl2024=()=>{
    const Iplteams =["RCB","SRH","MI","KKR","DC","RR","GT","LSG","CSK","PBKS"]
    return(
        <React.Fragment>
        {
            Iplteams.map((value)=>{
                return(
                    <>
                    <h2>{value}</h2>
                    </>
                
                  
                )
            })
        }
        </React.Fragment>
    )
}
export default Ipl2024
